//通用错误
message m_error_toc{
	optional int32   error_code = 1;
	optional string  args       = 2;
}
//基础数据
message m_user_toc{
	optional string   s_id = 1;							//唯一标识
	optional int32   id = 2;							//暂时无用
	optional string   account = 3;						//账号
	optional string	name = 4;							//真实名字
	optional string   platform = 5;						//手机号码
	optional int32   sex = 6;							//性别
	optional string   nickname = 7;						//昵称
	optional string	c_code = 8;							//国家代码
	optional string phone = 9;							//0普通1员工2gm
	optional int32   register_time = 10;						//手机号码
	optional string   agent = 11;						//手机号码
	optional int32   status = 12;						//用户状态0正常1冻结
}
//基础常变数据
message m_user_info_toc{
	optional string   s_id = 1;
	optional int64   gold = 2;								//金币
	optional int64   diamonds = 3;							//钻石
	optional int64   game_id = 4;							//游戏
	optional int64   room_id = 5;							//房间
	optional int64   desk_id = 6;							//桌子
}

message m_notice_msg_toc{
	optional int32   type = 1;//消息类型
	repeated string  args = 2;//参数
	repeated string  params = 3;//额外参数(比如比赛id)
}

message p_bets_limit{
	optional int32  area = 1;									//区域
	optional int32  limit = 2;									//投注上线
}
